module.exports = JSON.parse('{"fundamentals":{"introduction-to-computers":{"title":"Introduction to Computers","content":"# Introduction to Computers\\n\\nA computer is an electronic device that can store, retrieve, and process data. It performs tasks according to instructions provided by a program."},"computer-full-form":{"title":"Computer Full Form","content":"COMPUTER stands for **Common Operating Machine Purposely Used for Technological and Educational Research**."},"computer-introduction":{"title":"Computer Introduction","content":"A computer is a machine that takes input, processes it, stores data, and produces output.\\n\\n**Example:** Using a computer, you can calculate monthly expenses in seconds instead of manually."},"definition-and-characteristics-of-computers":{"title":"Definition and Characteristics of Computers","content":"Computers are fast, accurate, and can automate tasks. Key characteristics:\\n- **Speed**: Performs millions of calculations per second\\n- **Accuracy**: Very low error rate\\n- **Automation**: Works automatically once programmed\\n- **Storage**: Can store large amounts of data\\n- **Multitasking**: Can run multiple programs simultaneously"},"weakness-and-strength-of-computers":{"title":"Weakness and Strength of Computers","content":"**Strengths:**\\n- High speed and accuracy\\n- Large storage capacity\\n- Automation of tasks\\n\\n**Weaknesses:**\\n- Cannot think like humans\\n- Requires electricity\\n- Prone to viruses and hacking"},"history-of-computers-and-generations":{"title":"History of Computers and Generations","content":"Computers have evolved through generations:\\n1. **First Generation (1940-1956)**: Vacuum Tubes\\n2. **Second Generation (1956-1963)**: Transistors\\n3. **Third Generation (1964-1971)**: Integrated Circuits\\n4. **Fourth Generation (1971-Present)**: Microprocessors\\n5. **Fifth Generation (Present-Future)**: Artificial Intelligence"},"types-of-computers":{"title":"Types of Computers","content":"1. **Desktop**: Stationary, office/home use\\n2. **Laptop**: Portable, built-in screen\\n3. **Tablet**: Touch-screen portable device\\n4. **Smartphone**: Mobile computing device"},"classification-by-purpose":{"title":"Classification by Purpose","content":"1. **Analog**: Continuous data processing\\n2. **Digital**: Processes numeric data\\n3. **Hybrid**: Combination of analog and digital\\n\\n**Example:** A digital computer calculates numbers, analog measures temperature, and hybrid can do both."},"applications-of-computers":{"title":"Applications of Computers","content":"- **Education:** Online learning platforms\\n- **Business:** Accounting and billing software\\n- **Healthcare:** Hospital management systems\\n- **Entertainment:** Video games and movies"},"computer-system-components":{"title":"Computer System Components","content":"A computer system consists of **Hardware**, **Software**, and **Humanware** (users)."},"hardware":{"title":"Hardware","content":"Physical components of a computer:\\n\\n### Input Devices\\n- Keyboard, Mouse, Scanner, Microphone\\n\\n### Output Devices\\n- Monitor, Printer, Speakers, Projector\\n\\n### Storage Devices\\n- HDD, SSD, USB Drives, CD/DVD\\n\\n### CPU & Memory\\n- CPU (ALU, CU, Registers)\\n- RAM (Primary memory)\\n- Hard Disk/SSD (Secondary memory)"},"software":{"title":"Software","content":"Programs that control hardware and perform tasks:\\n\\n### System Software\\n- Operating System (Windows, Linux, macOS)\\n- Utility Programs (Antivirus, Disk Cleanup)\\n\\n### Application Software\\n- Word Processor, Spreadsheets, Web Browsers\\n\\n### Utility Software\\n- Backup, Antivirus, Disk Formatter\\n\\n### Firmware & Middleware\\n- Firmware: Embedded software in hardware\\n- Middleware: Connects different software systems"},"humanware":{"title":"Humanware","content":"Users who operate and interact with the computer system."},"computer-architecture-organization":{"title":"Computer Architecture & Organization","content":"### Block Diagram\\nShows interaction between Input, Output, CPU, Memory, and Storage.\\n\\n### Von Neumann Architecture\\nProgram instructions and data share the same memory.\\n\\n### Functional Units\\n- Input Unit\\n- Output Unit\\n- Memory Unit\\n- Arithmetic & Logic Unit (ALU)\\n- Control Unit (CU)\\n\\n### Data Representation\\n- Bits, Bytes, Words\\n- ASCII, Unicode, EBCDIC\\n\\n### Number Systems\\n- Binary, Decimal, Octal, Hexadecimal\\n- Conversion between systems\\n\\n### Binary Arithmetic\\n- Addition, Subtraction, Multiplication, Division\\n- 1s and 2s Complement\\n\\n### Logic Gates & Boolean Algebra\\n- AND, OR, NOT, NAND, NOR, XOR"},"memory-and-storage":{"title":"Memory and Storage","content":"### Primary Memory\\n- RAM (SRAM, DRAM), ROM (PROM, EPROM, EEPROM)\\n\\n### Secondary Memory\\n- HDD, SSD, CD/DVD\\n\\n### Cache Memory\\n- Fast memory between CPU and RAM\\n\\n### Virtual Memory\\n- Uses disk space to extend RAM temporarily\\n\\n### Flash Memory\\n- Used in USB drives and SSDs\\n\\n### Memory Hierarchy\\n- Registers  Cache  RAM  Secondary storage\\n\\n### Access Types\\n- Sequential, Direct, Random"},"operating-systems":{"title":"Operating Systems","content":"### Introduction to OS\\nSoftware that manages hardware and software resources.\\n\\n### Types of OS\\n- Windows, Linux, macOS, Real-Time, Batch, Distributed\\n\\n### File Management & User Interface\\n- CLI (Command Line Interface), GUI (Graphical User Interface)"},"networking-basics":{"title":"Networking Basics","content":"### Types of Networks\\n- LAN, WAN, MAN, PAN\\n\\n### Network Devices\\n- Hub, Switch, Router, Modem, Gateway\\n\\n### Protocols\\n- TCP/IP, HTTP, FTP, SMTP, DNS\\n\\n### IP Addressing\\n- IPv4, IPv6"},"data-security-cybersecurity":{"title":"Data Security & Cybersecurity","content":"### Computer Security Importance\\nProtect data and systems.\\n\\n### Types of Threats\\n- Virus, Worm, Trojan, Phishing, Ransomware\\n\\n### Security Measures\\n- Antivirus, Firewall, Encryption, Authentication\\n\\n### Cyber Ethics & Laws\\n- Legal and ethical usage of computers"},"computer-programming-basics":{"title":"Computer Programming Basics","content":"### Algorithms & Flowcharts\\nStep-by-step procedure to solve a problem.\\n\\n### Programming Languages\\n- Low-level, High-level, SQL\\n\\n### Translators\\n- Compiler, Interpreter, Assembler\\n\\n### Control Structures & Loops\\n- If-Else, For, While, Switch\\n\\n### Introduction to OOP\\n- Classes, Objects, Inheritance, Polymorphism"},"practical-computer-skills":{"title":"Practical Computer Skills","content":"### MS Office Basics\\n- Word, Excel, PowerPoint, Access\\n\\n### Internet & Email Usage\\n- Browsers, Gmail, Online communication\\n\\n### File & Folder Management\\n- Create, copy, move, delete files and folders\\n\\n### Safe Browsing Practices\\n- Antivirus, secure sites, strong passwords\\n\\n### Basic Troubleshooting\\n- Restarting programs, checking connections, software updates"}},"dca":{"computer-fundamentals":{"title":"Computer Fundamentals","content":"# Computer Fundamentals\\n\\n## What is a Computer?\\n\\nA computer is an electronic device that processes data according to a set of instructions called a program. It can store, retrieve, and process data.\\n\\n## Basic Components\\n\\n### Input Devices\\n- **Keyboard**: Used for typing text and commands\\n- **Mouse**: Pointing device for navigation\\n- **Scanner**: Converts physical documents to digital format\\n- **Microphone**: Records audio input\\n\\n### Output Devices\\n- **Monitor**: Displays visual output\\n- **Printer**: Produces hard copy output\\n- **Speakers**: Produces audio output\\n\\n### Processing Unit\\n- **CPU (Central Processing Unit)**: The brain of the computer\\n- **RAM (Random Access Memory)**: Temporary storage for running programs\\n- **Hard Drive**: Permanent storage for files and programs\\n\\n## Types of Computers\\n\\n1. **Desktop Computer**: Stationary computer for office/home use\\n2. **Laptop**: Portable computer with built-in display\\n3. **Tablet**: Touch-screen portable device\\n4. **Smartphone**: Mobile computing device\\n\\n## Operating System\\n\\nAn operating system (OS) is software that manages computer hardware and software resources. Popular operating systems include:\\n- Windows (by Microsoft)\\n- macOS (by Apple)\\n- Linux (Open Source)\\n- Android (for mobile devices)\\n\\n## Computer Memory\\n\\n### Primary Memory\\n- **RAM**: Volatile memory (data lost when power off)\\n- **ROM**: Non-volatile memory (permanent storage)\\n\\n### Secondary Memory\\n- **Hard Disk Drive (HDD)**: Magnetic storage\\n- **Solid State Drive (SSD)**: Flash-based storage (faster)\\n- **USB Drive**: Portable storage\\n- **CD/DVD**: Optical storage\\n\\n## Units of Measurement\\n\\n- 1 Byte = 8 Bits\\n- 1 Kilobyte (KB) = 1024 Bytes\\n- 1 Megabyte (MB) = 1024 KB\\n- 1 Gigabyte (GB) = 1024 MB\\n- 1 Terabyte (TB) = 1024 GB\\n\\n## Computer Generations\\n\\n1. **First Generation (1940-1956)**: Vacuum Tubes\\n2. **Second Generation (1956-1963)**: Transistors\\n3. **Third Generation (1964-1971)**: Integrated Circuits\\n4. **Fourth Generation (1971-Present)**: Microprocessors\\n5. **Fifth Generation (Present-Future)**: Artificial Intelligence"},"ms-word":{"title":"Microsoft Word","content":"# Microsoft Word\\n\\n## Introduction\\n\\nMicrosoft Word is a word processing application used for creating, editing, and formatting documents.\\n\\n## Getting Started\\n\\n### Starting Word\\n1. Click Start Menu\\n2. Search for \\"Word\\" or find it in Microsoft Office folder\\n3. Click to open\\n\\n### Creating a New Document\\n- Click **File** > **New** > **Blank Document**\\n- Or use keyboard shortcut: **Ctrl + N**\\n\\n## Basic Features\\n\\n### Text Formatting\\n- **Bold**: Ctrl + B or click Bold button\\n- **Italic**: Ctrl + I\\n- **Underline**: Ctrl + U\\n- **Font Size**: Select text and choose size from toolbar\\n- **Font Color**: Click Font Color dropdown\\n\\n### Paragraph Formatting\\n- **Alignment**: Left (Ctrl + L), Center (Ctrl + E), Right (Ctrl + R), Justify (Ctrl + J)\\n- **Line Spacing**: Select paragraph > Line Spacing button\\n- **Bullets**: Click Bullets button or Ctrl + Shift + L\\n- **Numbering**: Click Numbering button\\n\\n### Page Setup\\n- **Margins**: Layout tab > Margins\\n- **Orientation**: Portrait or Landscape\\n- **Size**: A4, Letter, Legal, etc.\\n\\n## Advanced Features\\n\\n### Tables\\n1. Click **Insert** tab\\n2. Click **Table**\\n3. Select rows and columns\\n4. Or draw table manually\\n\\n### Images\\n1. Click **Insert** tab\\n2. Click **Pictures**\\n3. Browse and select image\\n4. Resize and position as needed\\n\\n### Headers and Footers\\n1. Click **Insert** tab\\n2. Click **Header** or **Footer**\\n3. Choose style and add content\\n\\n### Page Numbers\\n1. Click **Insert** tab\\n2. Click **Page Number**\\n3. Choose position and format\\n\\n## Important Shortcuts\\n\\n- **Ctrl + S**: Save document\\n- **Ctrl + O**: Open document\\n- **Ctrl + P**: Print\\n- **Ctrl + Z**: Undo\\n- **Ctrl + Y**: Redo\\n- **Ctrl + A**: Select all\\n- **Ctrl + C**: Copy\\n- **Ctrl + X**: Cut\\n- **Ctrl + V**: Paste\\n- **Ctrl + F**: Find\\n- **Ctrl + H**: Replace\\n\\n## Saving Your Work\\n\\n### Save As\\n1. Click **File** > **Save As**\\n2. Choose location\\n3. Enter file name\\n4. Select format (docx, pdf, etc.)\\n5. Click **Save**\\n\\n## Printing\\n\\n1. Click **File** > **Print** (or Ctrl + P)\\n2. Select printer\\n3. Choose number of copies\\n4. Select pages to print\\n5. Click **Print**"},"ms-excel":{"title":"Microsoft Excel","content":"# Microsoft Excel\\n\\n## Introduction\\n\\nMicrosoft Excel is a spreadsheet application used for data organization, calculation, and analysis.\\n\\n## Basic Concepts\\n\\n### Workbook and Worksheet\\n- **Workbook**: An Excel file (.xlsx)\\n- **Worksheet**: A single sheet in a workbook (Sheet1, Sheet2, etc.)\\n\\n### Cells, Rows, and Columns\\n- **Cell**: Intersection of row and column (e.g., A1, B2)\\n- **Row**: Horizontal line (numbered 1, 2, 3...)\\n- **Column**: Vertical line (labeled A, B, C...)\\n\\n## Entering Data\\n\\n### Types of Data\\n1. **Text**: Letters and words\\n2. **Numbers**: Numeric values\\n3. **Dates**: Date and time values\\n4. **Formulas**: Begin with = sign\\n\\n### Data Entry Tips\\n- Press **Enter** to move down\\n- Press **Tab** to move right\\n- Press **Arrow Keys** to navigate\\n\\n## Basic Formulas\\n\\n### Arithmetic Operations\\n- **Addition**: =A1+B1\\n- **Subtraction**: =A1-B1\\n- **Multiplication**: =A1*B1\\n- **Division**: =A1/B1\\n\\n### Common Functions\\n\\n#### SUM Function\\n```excel\\n=SUM(A1:A10)\\n```\\nAdds all values in range A1 to A10\\n\\n#### AVERAGE Function\\n```excel\\n=AVERAGE(A1:A10)\\n```\\nCalculates average of values\\n\\n#### MAX and MIN\\n```excel\\n=MAX(A1:A10)  \'Finds maximum value\\n=MIN(A1:A10)  \'Finds minimum value\\n```\\n\\n#### COUNT Function\\n```excel\\n=COUNT(A1:A10)  \'Counts cells with numbers\\n=COUNTA(A1:A10) \'Counts non-empty cells\\n```\\n\\n## Formatting\\n\\n### Number Formatting\\n- **Currency**: Click Currency button or Ctrl + Shift + $\\n- **Percentage**: Click % button or Ctrl + Shift + %\\n- **Date**: Right-click > Format Cells > Date\\n\\n### Cell Formatting\\n- **Bold**: Ctrl + B\\n- **Background Color**: Fill Color button\\n- **Borders**: Border dropdown\\n- **Merge Cells**: Select cells > Merge & Center\\n\\n## Working with Data\\n\\n### Sorting\\n1. Select data range\\n2. Click **Data** tab\\n3. Click **Sort A to Z** or **Sort Z to A**\\n\\n### Filtering\\n1. Select header row\\n2. Click **Data** tab > **Filter**\\n3. Click dropdown arrows to filter\\n\\n### AutoFill\\n1. Enter value in cell\\n2. Hover over bottom-right corner (fill handle)\\n3. Drag down or across to copy\\n\\n## Charts and Graphs\\n\\n### Creating a Chart\\n1. Select data range\\n2. Click **Insert** tab\\n3. Choose chart type (Column, Line, Pie, etc.)\\n4. Customize as needed\\n\\n## Important Shortcuts\\n\\n- **Ctrl + N**: New workbook\\n- **Ctrl + S**: Save\\n- **Ctrl + C**: Copy\\n- **Ctrl + V**: Paste\\n- **Ctrl + X**: Cut\\n- **Ctrl + Z**: Undo\\n- **Ctrl + Arrow**: Jump to edge of data\\n- **F2**: Edit cell\\n- **Ctrl + Home**: Go to cell A1"},"ms-powerpoint":{"title":"Microsoft PowerPoint","content":"# Microsoft PowerPoint\\n\\n## Introduction\\n\\nMicrosoft PowerPoint is a presentation software used to create slideshows for meetings, lectures, and presentations.\\n\\n## Getting Started\\n\\n### Creating a New Presentation\\n1. Open PowerPoint\\n2. Choose a template or blank presentation\\n3. Start adding content\\n\\n### Presentation Views\\n- **Normal View**: Edit slides\\n- **Slide Sorter**: Rearrange slides\\n- **Slide Show**: Present to audience\\n- **Notes Page**: Add speaker notes\\n\\n## Working with Slides\\n\\n### Adding New Slides\\n- Click **New Slide** button\\n- Or press **Ctrl + M**\\n- Choose layout (Title, Content, Blank, etc.)\\n\\n### Slide Layouts\\n- **Title Slide**: For presentation opening\\n- **Title and Content**: Standard slide\\n- **Two Content**: Side-by-side content\\n- **Blank**: Custom layout\\n\\n## Adding Content\\n\\n### Text\\n1. Click text box\\n2. Type content\\n3. Format using toolbar\\n\\n### Images\\n1. Click **Insert** tab\\n2. Click **Pictures**\\n3. Browse and select\\n4. Resize and position\\n\\n### Shapes\\n1. Click **Insert** tab > **Shapes**\\n2. Select shape\\n3. Draw on slide\\n4. Add text if needed\\n\\n### SmartArt\\n1. Click **Insert** tab > **SmartArt**\\n2. Choose category and style\\n3. Enter text in boxes\\n\\n## Formatting\\n\\n### Themes and Design\\n1. Click **Design** tab\\n2. Choose theme\\n3. Customize colors and fonts\\n\\n### Slide Master\\n1. Click **View** tab > **Slide Master**\\n2. Edit master slide\\n3. Changes apply to all slides\\n\\n## Animations\\n\\n### Adding Animations\\n1. Select object\\n2. Click **Animations** tab\\n3. Choose animation effect\\n4. Set timing and order\\n\\n### Animation Types\\n- **Entrance**: Object appears\\n- **Emphasis**: Object highlighted\\n- **Exit**: Object disappears\\n- **Motion Paths**: Object moves\\n\\n## Transitions\\n\\n### Slide Transitions\\n1. Click **Transitions** tab\\n2. Choose transition effect\\n3. Set duration\\n4. Apply to all or selected slides\\n\\n## Presenting\\n\\n### Slide Show\\n- Press **F5** to start from beginning\\n- Press **Shift + F5** to start from current slide\\n- Use arrow keys or click to advance\\n- Press **Esc** to exit\\n\\n### Presenter View\\n- Shows notes and next slide\\n- Timer and slide counter\\n- Available on dual monitors\\n\\n## Important Shortcuts\\n\\n- **Ctrl + M**: New slide\\n- **Ctrl + D**: Duplicate slide\\n- **Ctrl + S**: Save\\n- **F5**: Start slideshow\\n- **Shift + F5**: Start from current slide\\n- **B**: Black screen during presentation\\n- **W**: White screen during presentation\\n- **Esc**: Exit slideshow\\n\\n## Best Practices\\n\\n1. **Keep it Simple**: Avoid clutter\\n2. **Use Images**: Visual appeal\\n3. **Limit Text**: Bullet points only\\n4. **Consistent Design**: Use same theme\\n5. **Large Fonts**: Readable from distance\\n6. **Practice**: Rehearse before presenting"},"internet-email":{"title":"Internet & Email","content":"# Internet & Email\\n\\n## What is Internet?\\n\\nThe Internet is a global network of computers connected together, allowing communication and information sharing worldwide.\\n\\n## Internet Basics\\n\\n### WWW (World Wide Web)\\n- Collection of websites and web pages\\n- Accessed through web browsers\\n- Uses HTTP/HTTPS protocols\\n\\n### Web Browsers\\n- **Google Chrome**: Fast and popular\\n- **Mozilla Firefox**: Privacy-focused\\n- **Microsoft Edge**: Windows default\\n- **Safari**: Apple devices\\n\\n### URL (Uniform Resource Locator)\\nExample: https://www.example.com\\n- **https://**: Protocol (secure)\\n- **www**: Subdomain\\n- **example**: Domain name\\n- **.com**: Top-level domain\\n\\n## Searching the Web\\n\\n### Search Engines\\n- **Google**: Most popular\\n- **Bing**: Microsoft search\\n- **Yahoo**: Classic search engine\\n- **DuckDuckGo**: Privacy-focused\\n\\n### Search Tips\\n1. Use specific keywords\\n2. Use quotes for exact phrases: \\"computer course\\"\\n3. Use minus to exclude: laptop -gaming\\n4. Use site: to search specific site\\n\\n## Email Basics\\n\\n### What is Email?\\nElectronic mail - sending messages over the internet.\\n\\n### Email Components\\n- **To**: Recipient\'s email address\\n- **CC**: Carbon Copy (others can see)\\n- **BCC**: Blind Carbon Copy (hidden recipients)\\n- **Subject**: Topic of email\\n- **Body**: Main message content\\n- **Attachments**: Files attached to email\\n\\n## Gmail\\n\\n### Creating Gmail Account\\n1. Go to gmail.com\\n2. Click \\"Create Account\\"\\n3. Fill in details\\n4. Verify phone number\\n5. Complete setup\\n\\n### Composing Email\\n1. Click **Compose** button\\n2. Enter recipient email\\n3. Add subject\\n4. Type message\\n5. Click **Send**\\n\\n### Email Organization\\n- **Inbox**: Received emails\\n- **Sent**: Sent emails\\n- **Drafts**: Unsent emails\\n- **Spam**: Junk mail\\n- **Trash**: Deleted emails\\n\\n### Gmail Features\\n- **Labels**: Organize emails\\n- **Filters**: Auto-organize incoming mail\\n- **Search**: Find emails quickly\\n- **Stars**: Mark important emails\\n\\n## Email Etiquette\\n\\n### Professional Email Tips\\n1. **Clear Subject**: Descriptive subject line\\n2. **Proper Greeting**: Dear Sir/Madam, Hello [Name]\\n3. **Concise Content**: Brief and to the point\\n4. **Professional Tone**: Polite and formal\\n5. **Signature**: Include your name and contact\\n6. **Proofread**: Check spelling and grammar\\n7. **Reply Promptly**: Respond within 24 hours\\n\\n### What to Avoid\\n- ALL CAPS (considered shouting)\\n- Too many exclamation marks!!!\\n- Informal language in professional emails\\n- Large attachments (compress if needed)\\n- Reply All unless necessary\\n\\n## Online Safety\\n\\n### Password Security\\n- Use strong passwords (mix of letters, numbers, symbols)\\n- Different passwords for different sites\\n- Change passwords regularly\\n- Enable two-factor authentication\\n\\n### Phishing Awareness\\n- Don\'t click suspicious links\\n- Verify sender email address\\n- Don\'t share personal information\\n- Check for https:// in URLs\\n\\n### Safe Browsing\\n- Keep browser updated\\n- Use antivirus software\\n- Be careful with downloads\\n- Use secure Wi-Fi connections\\n\\n## Cloud Storage\\n\\n### Google Drive\\n- 15 GB free storage\\n- Store and share files\\n- Access from anywhere\\n- Collaborate in real-time\\n\\n### Using Google Drive\\n1. Go to drive.google.com\\n2. Sign in with Gmail\\n3. Click **New** to upload\\n4. Right-click to share files\\n\\n## Video Conferencing\\n\\n### Popular Platforms\\n- **Zoom**: Meetings and webinars\\n- **Google Meet**: Integrated with Gmail\\n- **Microsoft Teams**: Business communication\\n- **Skype**: Video and voice calls\\n\\n### Basic Tips\\n- Test audio/video before meeting\\n- Mute when not speaking\\n- Use headphones to avoid echo\\n- Good lighting for video\\n- Professional background"}},"ms-office":{"word-advanced":{"title":"MS Word Advanced","content":"# Microsoft Word - Advanced Features\\n\\n## Styles and Themes\\n\\n### Using Styles\\nStyles are pre-defined formatting sets that ensure consistency throughout your document.\\n\\n1. Select text\\n2. Click **Home** tab > **Styles** group\\n3. Choose style (Heading 1, Heading 2, Normal, etc.)\\n\\n### Creating Custom Styles\\n1. Format text as desired\\n2. Right-click style name\\n3. Click **Update to Match Selection**\\n4. Or create new style\\n\\n## Table of Contents\\n\\n### Auto-Generate TOC\\n1. Apply heading styles to document sections\\n2. Place cursor where TOC should appear\\n3. Click **References** tab > **Table of Contents**\\n4. Choose style\\n5. TOC updates automatically when headings change\\n\\n## Mail Merge\\n\\nCreate personalized letters, labels, or envelopes for multiple recipients.\\n\\n### Steps\\n1. Click **Mailings** tab > **Start Mail Merge**\\n2. Choose document type (Letters, Envelopes, etc.)\\n3. Click **Select Recipients**\\n4. Create or select data source (Excel file)\\n5. Insert merge fields where needed\\n6. Preview results\\n7. Complete merge\\n\\n## Track Changes\\n\\nCollaborate and review document edits.\\n\\n### Enable Tracking\\n1. Click **Review** tab\\n2. Click **Track Changes**\\n3. All edits now shown in color\\n\\n### Reviewing Changes\\n- **Accept**: Keep the change\\n- **Reject**: Revert to original\\n- **Next/Previous**: Navigate changes\\n\\n## Document Protection\\n\\n### Restrict Editing\\n1. Click **Review** tab > **Restrict Editing**\\n2. Choose restrictions\\n3. Set password (optional)\\n4. Start enforcing protection\\n\\n## Templates\\n\\n### Using Templates\\n1. Click **File** > **New**\\n2. Search for template type\\n3. Select and click **Create**\\n4. Customize content\\n\\n### Creating Templates\\n1. Design document\\n2. Click **File** > **Save As**\\n3. Choose **Word Template (.dotx)**\\n4. Save in Templates folder\\n\\n## Advanced Formatting\\n\\n### Columns\\n1. Select text\\n2. Click **Layout** tab > **Columns**\\n3. Choose number of columns\\n\\n### Drop Caps\\n1. Click in paragraph\\n2. Click **Insert** tab > **Drop Cap**\\n3. Choose style\\n\\n### Watermarks\\n1. Click **Design** tab > **Watermark**\\n2. Choose preset or custom\\n3. Appears on all pages\\n\\n## Macros\\n\\nAutomate repetitive tasks.\\n\\n### Recording a Macro\\n1. Click **View** tab > **Macros** > **Record Macro**\\n2. Name the macro\\n3. Perform actions to record\\n4. Click **Stop Recording**\\n\\n### Running a Macro\\n1. Click **View** tab > **Macros** > **View Macros**\\n2. Select macro name\\n3. Click **Run**"},"excel-advanced":{"title":"MS Excel Advanced","content":"# Microsoft Excel - Advanced Features\\n\\n## Advanced Formulas\\n\\n### IF Function\\n```excel\\n=IF(condition, value_if_true, value_if_false)\\n```\\nExample:\\n```excel\\n=IF(A1>50, \\"Pass\\", \\"Fail\\")\\n```\\n\\n### VLOOKUP\\nSearch for value in first column and return value from another column.\\n```excel\\n=VLOOKUP(lookup_value, table_array, col_index_num, [range_lookup])\\n```\\nExample:\\n```excel\\n=VLOOKUP(A2, B2:D10, 3, FALSE)\\n```\\n\\n### SUMIF and COUNTIF\\n```excel\\n=SUMIF(range, criteria, [sum_range])\\n=COUNTIF(range, criteria)\\n```\\nExample:\\n```excel\\n=SUMIF(A1:A10, \\">100\\", B1:B10)\\n=COUNTIF(A1:A10, \\"Apple\\")\\n```\\n\\n### Nested IF\\n```excel\\n=IF(A1>=90, \\"A\\", IF(A1>=80, \\"B\\", IF(A1>=70, \\"C\\", \\"F\\")))\\n```\\n\\n## Pivot Tables\\n\\nPowerful tool for data analysis and summarization.\\n\\n### Creating Pivot Table\\n1. Select data range\\n2. Click **Insert** tab > **PivotTable**\\n3. Choose where to place it\\n4. Drag fields to areas:\\n   - Rows\\n   - Columns\\n   - Values\\n   - Filters\\n\\n### Pivot Table Features\\n- Group data by date/category\\n- Show values as percentages\\n- Apply filters\\n- Refresh when source data changes\\n\\n## Data Validation\\n\\nControl what users can enter in cells.\\n\\n### Setting Validation\\n1. Select cells\\n2. Click **Data** tab > **Data Validation**\\n3. Choose criteria:\\n   - Whole number\\n   - Decimal\\n   - List\\n   - Date\\n   - Text length\\n4. Add input message and error alert\\n\\n### Creating Dropdown Lists\\n1. Select cell\\n2. Data Validation > List\\n3. Enter values separated by commas\\n4. Or select range\\n\\n## Conditional Formatting\\n\\nFormat cells based on their values.\\n\\n### Applying Conditional Formatting\\n1. Select range\\n2. Click **Home** tab > **Conditional Formatting**\\n3. Choose rule type:\\n   - Highlight Cells Rules\\n   - Top/Bottom Rules\\n   - Data Bars\\n   - Color Scales\\n   - Icon Sets\\n\\n### Custom Rules\\n1. Conditional Formatting > New Rule\\n2. Use formula to determine formatting\\n3. Example: `=A1>100`\\n4. Set format\\n\\n## Charts and Sparklines\\n\\n### Advanced Charts\\n- **Combo Charts**: Mix chart types\\n- **Waterfall Charts**: Show cumulative effect\\n- **Funnel Charts**: Show stages in process\\n- **Treemap**: Show hierarchical data\\n\\n### Sparklines\\nMini charts within cells.\\n\\n1. Select cell for sparkline\\n2. Click **Insert** tab > **Sparklines**\\n3. Choose type (Line, Column, Win/Loss)\\n4. Select data range\\n\\n## Data Analysis\\n\\n### Goal Seek\\nFind input value to achieve desired result.\\n\\n1. Click **Data** tab > **What-If Analysis** > **Goal Seek**\\n2. Set cell: Formula cell\\n3. To value: Desired result\\n4. By changing cell: Input cell\\n\\n### Solver\\nFind optimal solution with constraints.\\n\\n1. Click **Data** tab > **Solver**\\n2. Set objective\\n3. Add constraints\\n4. Click **Solve**\\n\\n## Working with Large Data\\n\\n### Freeze Panes\\n1. Select cell below/right of freeze point\\n2. Click **View** tab > **Freeze Panes**\\n3. Headers remain visible while scrolling\\n\\n### Remove Duplicates\\n1. Select data\\n2. Click **Data** tab > **Remove Duplicates**\\n3. Choose columns to check\\n4. Click OK\\n\\n### Text to Columns\\nSplit data into multiple columns.\\n\\n1. Select column\\n2. Click **Data** tab > **Text to Columns**\\n3. Choose Delimited or Fixed Width\\n4. Set options\\n5. Finish\\n\\n## Protecting Workbooks\\n\\n### Protect Sheet\\n1. Click **Review** tab > **Protect Sheet**\\n2. Set password (optional)\\n3. Choose what users can do\\n4. Click OK\\n\\n### Protect Workbook\\n1. Click **Review** tab > **Protect Workbook**\\n2. Set password\\n3. Prevents adding/deleting sheets"}},"adca":{"advanced-excel":{"title":"Advanced Microsoft Excel","content":"# Advanced Microsoft Excel\\n\\n## Introduction\\n\\nAdvanced Excel is used for data analysis, automation, and business reporting. It includes formulas, charts, pivot tables, and macros.\\n\\n## Data Validation\\n- Restrict data entry using rules.\\n- Example: Allow only numbers between 1100.\\n- Go to **Data > Data Validation**.\\n\\n## Conditional Formatting\\n- Highlight cells based on criteria.\\n- Example: Color sales above 10,000 in green.\\n- Go to **Home > Conditional Formatting**.\\n\\n## Lookup Functions\\n### VLOOKUP\\n```excel\\n=VLOOKUP(lookup_value, table_array, col_index_num, [range_lookup])\\n```\\nExample:\\n```excel\\n=VLOOKUP(A2, B2:D10, 3, FALSE)\\n```\\n\\n### HLOOKUP\\n```excel\\n=HLOOKUP(lookup_value, table_array, row_index_num, [range_lookup])\\n```\\n\\n### XLOOKUP (Excel 2021+)\\n```excel\\n=XLOOKUP(lookup_value, lookup_array, return_array)\\n```\\n\\n## Pivot Tables\\n1. Select data range.\\n2. Go to **Insert > PivotTable**.\\n3. Choose rows, columns, and values.\\n4. Analyze and summarize data easily.\\n\\n## Charts and Dashboards\\n- Combine multiple charts for reports.\\n- Use **Slicers** and **Timeline** to filter data.\\n\\n## Macros\\n- Automate repetitive tasks.\\n- Record a macro: **View > Macros > Record Macro**.\\n- Use VBA for scripting.\\n\\n## Power Query\\n- Import and transform data from multiple sources.\\n- Go to **Data > Get & Transform Data**.\\n\\n## Important Shortcuts\\n- **Alt + =**: AutoSum\\n- **Ctrl + ;**: Insert date\\n- **Ctrl + Shift + L**: Toggle filters\\n- **Ctrl + Shift + $**: Apply currency format"},"tally-prime":{"title":"Tally Prime Accounting","content":"# Tally Prime Accounting\\n\\n## Introduction\\nTally Prime is an accounting software used for maintaining company accounts, GST, inventory, and payroll.\\n\\n## Creating a Company\\n1. Open Tally Prime.\\n2. Click **Create Company**.\\n3. Fill in details: Company Name, Address, GST, etc.\\n\\n## Accounting Basics\\n- **Voucher**: Record of financial transactions.\\n- **Ledger**: Account book of transactions.\\n- **Group**: Category of ledgers.\\n\\n## Types of Vouchers\\n- **Payment (F5)**\\n- **Receipt (F6)**\\n- **Journal (F7)**\\n- **Sales (F8)**\\n- **Purchase (F9)**\\n\\n## Creating Ledgers\\n1. Go to **Accounts Info > Ledgers > Create**.\\n2. Example:\\n   - Cash Account  Under **Cash-in-Hand**\\n   - Sales Account  Under **Sales Accounts**\\n\\n## Inventory Management\\n- **Stock Group**: Category of products.\\n- **Stock Item**: Individual product.\\n- **Unit of Measure**: e.g., Nos, Kg, Liters.\\n\\n## GST Configuration\\n1. Enable GST: **F11 > Statutory Features > Enable GST: Yes**\\n2. Create tax ledgers (CGST, SGST, IGST).\\n3. Apply to sales/purchase vouchers.\\n\\n## Reports\\n- **Balance Sheet**\\n- **Profit & Loss Account**\\n- **Day Book**\\n- **Trial Balance**\\n\\n## Shortcut Keys\\n- **Alt + C**: Create ledger on the fly.\\n- **Alt + F1**: Detailed view.\\n- **Ctrl + A**: Accept screen.\\n- **F2**: Change date."},"html-css":{"title":"HTML & CSS (Web Design Basics)","content":"# HTML & CSS (Web Design Basics)\\n\\n## Introduction to HTML\\nHTML (HyperText Markup Language) is used to structure web pages.\\n\\n### Basic Structure\\n```html\\n<!DOCTYPE html>\\n<html>\\n<head>\\n<title>My Web Page</title>\\n</head>\\n<body>\\n<h1>Welcome</h1>\\n<p>This is my first webpage.</p>\\n</body>\\n</html>\\n```\\n\\n### Common Tags\\n- **<h1> to <h6>**: Headings\\n- **<p>**: Paragraph\\n- **<a href=\\"\\">**: Link\\n- **<img src=\\"\\">**: Image\\n- **<ul>/<ol>**: Lists\\n- **<table>**: Tables\\n\\n## Introduction to CSS\\nCSS (Cascading Style Sheets) defines the style and layout.\\n\\n### Example\\n```html\\n<style>\\n  body { background-color: #f0f0f0; }\\n  h1 { color: blue; }\\n  p { font-size: 18px; }\\n</style>\\n```\\n\\n### External CSS\\n```html\\n<link rel=\\"stylesheet\\" href=\\"style.css\\">\\n```\\n\\n## Box Model\\n- **Content**  Text/Image area\\n- **Padding**  Space inside border\\n- **Border**  Surrounds padding\\n- **Margin**  Space outside border\\n\\n## Responsive Design\\n- Use **media queries**:\\n```css\\n@media (max-width: 600px) {\\n  body { background-color: lightgray; }\\n}\\n```\\n\\n## CSS Flexbox Example\\n```css\\n.container {\\n  display: flex;\\n  justify-content: center;\\n  align-items: center;\\n}\\n```"},"computer-networking":{"title":"Computer Networking","content":"# Computer Networking\\n\\n## What is Networking?\\nNetworking connects multiple computers to share resources and information.\\n\\n## Types of Networks\\n1. **LAN (Local Area Network)**  Small area (office, home)\\n2. **MAN (Metropolitan Area Network)**  City-wide\\n3. **WAN (Wide Area Network)**  Large area (Internet)\\n\\n## Network Devices\\n- **Router**: Connects different networks\\n- **Switch**: Connects multiple computers within a LAN\\n- **Hub**: Basic connection device\\n- **Modem**: Converts digital to analog signals\\n\\n## Network Topologies\\n- **Star**: Central hub (most common)\\n- **Bus**: Single backbone cable\\n- **Ring**: Circular connection\\n- **Mesh**: Every device connected to others\\n\\n## IP Addressing\\n- **IPv4 Example**: 192.168.1.1\\n- **IPv6 Example**: 2400:cb00:2048:1::c629:d7a2\\n\\n## Protocols\\n- **HTTP/HTTPS**  Web\\n- **FTP**  File transfer\\n- **SMTP/IMAP/POP3**  Email\\n- **TCP/IP**  Internet communication\\n\\n## Network Security\\n- Use firewalls\\n- Update antivirus software\\n- Encrypt data\\n- Use strong passwords"},"ms-access":{"title":"MS Access (Database Management)","content":"# MS Access (Database Management)\\n\\n## Introduction\\nMS Access is a database application used to store and manage structured data.\\n\\n## Key Objects\\n- **Tables**: Store data\\n- **Queries**: Filter and search data\\n- **Forms**: User-friendly data entry\\n- **Reports**: Printable summaries\\n\\n## Creating a Database\\n1. Open MS Access.\\n2. Click **File > New > Blank Database**.\\n3. Define table fields and data types.\\n\\n## Relationships\\n- One-to-One\\n- One-to-Many\\n- Many-to-Many\\n\\n## Query Example\\n- Show all customers from Delhi:\\n```sql\\nSELECT * FROM Customers WHERE City = \'Delhi\';\\n```\\n\\n## Forms and Reports\\n- Design custom forms for entry.\\n- Generate reports for printing."},"photoshop":{"title":"Adobe Photoshop (Basic)","content":"# Adobe Photoshop (Basic)\\n\\n## Introduction\\nPhotoshop is an image editing software used for designing, photo retouching, and graphics creation.\\n\\n## Tools Overview\\n- **Move Tool (V)**: Move selections\\n- **Marquee Tool (M)**: Select areas\\n- **Lasso Tool (L)**: Freehand selection\\n- **Brush Tool (B)**: Paint\\n- **Eraser Tool (E)**: Erase pixels\\n\\n## Layers\\n- Each element can be on a separate layer.\\n- Use **Layer Panel** to arrange or hide layers.\\n\\n## Image Adjustments\\n- **Brightness/Contrast**\\n- **Hue/Saturation**\\n- **Levels and Curves**\\n\\n## File Formats\\n- **PSD**: Editable format\\n- **JPG/PNG**: Final output\\n\\n## Shortcuts\\n- **Ctrl + N**: New file\\n- **Ctrl + S**: Save\\n- **Ctrl + T**: Transform\\n- **Ctrl + Z**: Undo"}}}');

